import axios from "axios";
import "./App.css";
import { WorkListTemplate } from "./components/worklist/WorkListTemplate";
import { useAxios } from "./hooks/useAxios";

function App() {
  const { loading, data, error, refetch } = useAxios({ url: "/api/hello" });
  console.log("STATE: ", data);
  return (
    <main>
      <article>
        test
        {/* axios.post("http") */}
        {`load: ${loading} data${data}  error${error}`}
        <button onClick={refetch}> CLICK </button>
      </article>
      <article>
        <WorkListTemplate />
      </article>
    </main>
  );
}

export default App;
